import React, { useState } from 'react';
import axios from 'axios';
import './Form.css';

const CreateMember = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    category: '',
    level: '',
    age_group: '',
    is_active: true
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData({
      ...formData,
      [name]: type === 'checkbox' ? checked : value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://127.0.0.1:8000/members/', formData);
      alert('Member created successfully!');
    } catch (error) {
      console.error('Error creating member:', error);
      alert('Failed to create member');
    }
  };

  return (
    <div className="form-container">
      <h2>Create Member</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>Name:</label>
          <input type="text" name="name" value={formData.name} onChange={handleChange} required />
        </div>
        <div className="form-group">
          <label>Email:</label>
          <input type="email" name="email" value={formData.email} onChange={handleChange} required />
        </div>
        <div className="form-group">
          <label>Category:</label>
          <input type="text" name="category" value={formData.category} onChange={handleChange} required />
        </div>
        <div className="form-group">
          <label>Level:</label>
          <input type="text" name="level" value={formData.level} onChange={handleChange} required />
        </div>
        <div className="form-group">
          <label>Age Group:</label>
          <input type="text" name="age_group" value={formData.age_group} onChange={handleChange} required />
        </div>
        <div className="form-group">
          <label>Is Active:</label>
          <input type="checkbox" name="is_active" checked={formData.is_active} onChange={handleChange} />
        </div>
        <button type="submit">Create Member</button>
      </form>
    </div>
  );
};

export default CreateMember;
